import React, { Component } from 'react';
import background from '../images/moviesBG.png';




class Home extends Component {

    sectionStyle = {
        width: "100%",
        height: "400px",
        backgroundImage: "url(" + { Background } + ")"
      };
      
    
        render() {
          return (
            <section style={ sectionStyle }>
            </section>
          );
        }
      }

export default Home;
